import React from "react";

function Projects() {
    const content = [
        ["Project 1 :", "The first project"],
        ["Project 2 :", "The second project"],
        ["Project 3 :", "The third project"]
    ];
    var index = 0;

    function move_index(to_add) {
        if (index == 0 && to_add == -1) {
            return false;
        }
        if (index == content.length && to_add == 1) {
            return false;
        }
        index += to_add;
        return true;
    }
    return (
        <div className="projects">
            <button onClick={move_index(-1)}>
                last
            </button>
            <div className="bck">
                {content[index][0]}<br />
                {content[index][1]}
            </div>
            <button onClick={move_index(1)}>
                next
            </button>
        </div>
    )
}

export default Projects;
